try
{
    //
    // make sure we don't have a directory where we expect a file
    //
    if ( f.exists() && f.isDirectory() )
    {
        throw new ArchiverException( "The path " + f + " already exists as a directory."
            + " Please remove this directory first." );
    }

   try
   {
	   if(! isDirectory)
	   {
		   if(f.exists() && !f.isFile())
		   {
			   throw new ArchiverException("The path " + f.getAbsolutePath() + " exists and is not a file.");
		   }
	   }
	   else
	   {
		   if(f.exists() && !f.isDirectory())
		   {
			   throw new ArchiverException("The path " + f.getAbsolutePath() + " exists and is not a directory.");
		   }
	   }

